import React from 'react';
import { Container } from './WeatherCard.styled';

function WeatherCard({city}) {
  return (
    <Container>
      <h1>{city.city}</h1>
      <p>Time</p>
      <p>Temperature</p>
      <p>Cloudy</p>
      <p>H:15 L</p>
    </Container>
  );
}

export default WeatherCard;
